ne.\">Site maintenance<span class=\'menu-description\'>Take the site off-line for maintenance or bring it back online.</span></a></li>\n<li class=\"leaf last\"><a href=\"/admin/settings/jquery_update\" title=\"Configure settings for jQuery Update module.\">jQuery Update<span class=\'menu-description\'>Configure settings for jQuery Update module.</span></a></li>\n</ul></li>\n<li class=\"expanded\"><a href=\"/admin/generate\" title=\"Populate your database with dummy items.\">Generate items<span class=\'menu-description\'>Populate your database with dummy items.</span></a><ul class=\"menu\"><li class=\"leaf first\"><a href=\"/admin/generate/taxonomy\" title=\"Generate a given number of vocabularies and terms. Optionally delete current categories.\">Generate categories<span class=\'menu-description\'>Generate a given number of vocabularies and terms. Optionally delete current categories.</span></a></li>\n<li class=\"leaf\"><a href=\"/admin/generate/content\" title=\"Generate a given number of nodes and comments. Optionally delete current items.\">Generate content<span class=\'menu-description\'>Generate a given number of nodes and comments. Optionally delete current items.</span></a></li>\n<li class=\"leaf last\"><a href=\"/admin/generate/user\" title=\"Generate a given number of users. Optionally delete current users.\">Generate users<span class=\'menu-description\'>Generate a given number of users. Optionally delete current users.</span></a></li>\n</ul></li>\n<li class=\"expanded\"><a href=\"/admin/user\" title=\"Manage your site&#039;s users, groups and access to site features.\">User management<span class=\'menu-description\'>Manage your site&#039;s users, groups and access to site features.</span></a><ul class=\"menu\"><li class=\"leaf first\"><a href=\"/admin/user/rules\" title=\"List and create rules to disallow usernames, e-mail addresses, and IP addresses.\">Access rules<span class=\'menu-description\'>List and create rules to disallow usernames, e-mail addres